import React from 'react';
import { Box } from '@material-ui/core';
import { CountUpNumber } from 'components/molecules';

export default function Counterplacer() {
  return (
    <Box marginBottom={2} padding={2} border="1px solid #ccc" borderRadius="4px" overflow="auto">
      <Box display="flex" justifyContent="space-around" alignItems="center" minWidth="600px">
        <CountUpNumber end={200} suffix="K" label="Installation" />
        <CountUpNumber end={260} prefix="$" suffix="K" label="RESEARCHERS" />
      
        <CountUpNumber end={60} suffix="+" label="EMPLOYEES" />
        <CountUpNumber end={15} suffix="+" label="BRANDS" />
      </Box>
    </Box>,
    <Box marginBottom={2} padding={2} border="1px solid #ccc" borderRadius="4px" overflow="auto">
    <Box display="flex" justifyContent="space-around" alignItems="center" minWidth="600px">
  
    
      <CountUpNumber end={60} suffix="+" label="EMPLOYEES" />
      <CountUpNumber end={15} suffix="+" label="BRANDS" />
    </Box>
  </Box>
  );
}
